import React from 'react'
import Cell from './Cell'

export default () => {

    const gridData = []
    const makecells = []
    for(let i=0;i<600;i++) {
        const x = i % 30
        const y = Math.floor(i / 30)
        const position = `${x},${y}`
        makecells.push(<Cell id={position}></Cell>)
        gridData[i] = {[position]: ''}
    }
    console.log(gridData)

    return (
        <>
            <div id='grid' className='grid'>
                {makecells}
            </div>
        </>
    )
}
